jQuery.extend(jQuery.fn.dataTableExt.oSort,{"datetime-us-flex-pre":function(k){if(k.indexOf("/")===-1){return"0"}else{var c=0,d=0,e=0;var j=k.match(/(\d{1,2})\/(\d{1,2})\/(\d{2,4})( (\d{1,2}):(\d{1,2}))? ?(am|pm|AM|PM|Am|Pm)?/),g=j[1],i=j[2],h=j[3];if(j[4]!=undefined){c=j[5];d=j[6]}if(j[7]!=undefined){e=j[7];if(c=="12"){c="0"}if(e=="pm"){c=parseInt(c,10)+12}}if(h.length==2){if(parseInt(h,10)<70){h="20"+h}else{h="19"+h}}if(g.length==1){g="0"+g}if(i.length==1){i="0"+i}if(c.length==1){c="0"+c}if(d.length==1){d="0"+d}var f=h+g+i+c+d;return f}},"datetime-us-flex-asc":function(d,c){return d-c},"datetime-us-flex-desc":function(d,c){return c-d}});